using System;

public static class Snippet
{
	public static void SousaSheetSet(AdvanceSoftware.ExcelCreator.Creator E_Creater, System.String SheetNamae, ref System.Int32 ixSheetNo)
	{
		ixSheetNo = E_Creater.SheetNo2(SheetNamae);
		if (ixSheetNo >= 0)
		{
			E_Creater.SheetNo = ixSheetNo;
		}
	}

}

