using System;

public static class Snippet
{
	public static void TO_EXCEL(AdvanceSoftware.ExcelCreator.Creator E_Creater, System.String CellName, System.Int32 xlsRow, System.Int16 CellType, System.Int64 Num1, System.Double Num2, System.String Str1, System.String Str2, System.String DateStr)
	{
		if (CellType == 1)
		{
			if (Num2 != 0)
			{
		   	E_Creater.Cell(CellName,0,xlsRow).Double = Num2;
			}
	  		else 
			{
		   	E_Creater.Cell(CellName,0,xlsRow).Int64 = Num1;
			}
		}
		if (CellType == 2)
		{
			if (Str2 != "")
			{
		   	E_Creater.Cell(CellName,0,xlsRow).Value = Str2;
			}
	  		else 
			{
			E_Creater.Cell(CellName,0,xlsRow).Value = Str1;
			}
		}
		if (CellType == 3)
		{
			E_Creater.Cell(CellName,0,xlsRow).Value = Convert.ToDateTime(DateStr).ToOADate();
		}
	}

}

using System;

public static class Snippet
{
	public static void SET_FontCOLOR(AdvanceSoftware.ExcelCreator.Creator E_Creater, System.String CellName, System.Int16 xlsRow, System.Int16 FColor)
	{
		switch(FColor)
		{
		case 1:
		   E_Creater.Cell(CellName,0,xlsRow).Attr.FontColor2= AdvanceSoftware.ExcelCreator.xlColor.Black;
		   break;
		case 2:
		   E_Creater.Cell(CellName,0,xlsRow).Attr.FontColor2= AdvanceSoftware.ExcelCreator.xlColor.Red;
		   break;
		case 3:
		   E_Creater.Cell(CellName,0,xlsRow).Attr.FontColor2= AdvanceSoftware.ExcelCreator.xlColor.Blue;
			break;
		case 4:
		   E_Creater.Cell(CellName,0,xlsRow).Attr.FontColor2= AdvanceSoftware.ExcelCreator.xlColor.Yellow;
			break;
		case 5:
		   E_Creater.Cell(CellName,0,xlsRow).Attr.FontColor2= AdvanceSoftware.ExcelCreator.xlColor.White;
			break;
		}		
	}

}

