using System;

public static class Snippet
{
	public static void SheetCopyActive(AdvanceSoftware.ExcelCreator.Creator E_Creater, System.String SheetNamae, ref System.Int32 ixSheetNo, System.String NewSheetNamae, System.Int32 ixNewSheetNo)
	{
		ixSheetNo = E_Creater.SheetNo2(SheetNamae);
		if (ixSheetNo >= 0)
		{
			E_Creater.CopySheet(ixSheetNo,ixNewSheetNo,NewSheetNamae);
			E_Creater.SheetNo = ixNewSheetNo;
		}
	}

}

