using System;

public static class Snippet
{
	public static void Syasen(AdvanceSoftware.ExcelCreator.Creator E_Creater, System.String CellName, System.Int16 SyasenType, AdvanceSoftware.ExcelCreator.BorderStyle Sensyu, AdvanceSoftware.ExcelCreator.xlColor SenIro)
	{
		if (SyasenType == 0)
		{
		   E_Creater.Cell(CellName).Attr.LineRightUp (Sensyu,SenIro);
		}
		else
		{
		   E_Creater.Cell(CellName).Attr.LineLeftUp (Sensyu,SenIro);
		}
	}

}

