using System;

public static class Snippet
{
	public static void Haiti(AdvanceSoftware.ExcelCreator.Creator E_Creater, System.String CellName, System.Int16 YokoIti)
	{
		switch (YokoIti) //0:中央揃え  1:左詰め  2:右詰め  3:選択範囲内で中央  4:均等割り付け  5:両端揃え
		{
			case 0:
			    E_Creater.Cell(CellName).Attr.HorizontalAlignment = AdvanceSoftware.ExcelCreator.HorizontalAlignment.Center;
				break;
			case 1:
			    E_Creater.Cell(CellName).Attr.HorizontalAlignment = AdvanceSoftware.ExcelCreator.HorizontalAlignment.Left;
			    break;
			case 2:
			    E_Creater.Cell(CellName).Attr.HorizontalAlignment = AdvanceSoftware.ExcelCreator.HorizontalAlignment.Right;
				break;
			case 3:
			    E_Creater.Cell(CellName).Attr.HorizontalAlignment = AdvanceSoftware.ExcelCreator.HorizontalAlignment.CenterContinuous;
				break;
			case 4:
			    E_Creater.Cell(CellName).Attr.HorizontalAlignment = AdvanceSoftware.ExcelCreator.HorizontalAlignment.Justify;
				break;
			case 5:
			    E_Creater.Cell(CellName).Attr.HorizontalAlignment = AdvanceSoftware.ExcelCreator.HorizontalAlignment.Distributed;
				break;
		}		
	}
}
